            <form method=\"POST\">
                {% if error %}
                    <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                {% endif %}
                <input type=\"text\" value=\"{{ last_username }}\" name=\"username\" id=\"inputUsername\" placeholder=\"Identifiant\" required autofocus>
          
                <input type=\"password\" name=\"password\" id=\"inputPassword\" placeholder=\"Mot de passe\" required>

                <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
        
                <button type=\"submit\">Connexion</button>
            </form>
        {% endblock %}
        
        <footer><p>&copy; Cheik-Siramakan Keita 2018-{{ \"now\"|date('Y') }}</p></footer>

